import React from 'react';

import { Wrapper,Content,Text  } from './HeroImage.styles';

const HeroImage = ({image,title,text}) => (
    <Wrapper image={image}>
        {console.log(image)}
        <Content>
            <Text>
                <h1>{title}</h1>
                <p>{text}</p>
            </Text>
        </Content>
    </Wrapper>
);

export default HeroImage;
